INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, 'Bonjour ! Et bienvenue sur la base de connaissance de [Glasshouse](http://www.glasshouse.fr)\r\n', '', 'plain_text'),
('node', 'article', 0, 2, 2, 'und', 0, '[Article original](http://stirredbits.com/blog/2012/03/14/how-to-change-a-git-submodule-url/)\r\n\r\nLet ‘yourproject’ be your git working directory, ‘supercoolib’ the submodule and ‘yourusername’ your github username. Open with an editor of your choice (in my case emacs) the .gitmodules file (usually is located at the root of the repo):\r\n\r\n    $ cd yourproject\r\n    $ emacs .gitmodule\r\n\r\nYou should see something like this:\r\n\r\n    [submodule “supercoolib”]\r\n    path = lib/supercoolib\r\n    url = https://github.com/anotherusername/supercoolib.git\r\n\r\nChange the url of the repo like that:\r\n\r\n    [submodule “supercoolib”]\r\n    path = lib/supercoolib\r\n    url = https://github.com/yourusername/supercoolib.git\r\n\r\nNow tell git to update his internal reference:	\r\n\r\n    $ git submodule sync\r\n\r\nAnd then init(if you didn’t already) and update the submodules:	\r\n\r\n    $ git submodule init\r\n    $ git submodule update\r\n\r\nDon’t forget to checkout the branch inside the submodule (remember? submodules have a detached HEAD):\r\n\r\n    $ cd lib/supercoolib\r\n    $ git checkout master\r\n\r\nCheck if everything is working and finally commit your changes ;)', '', 'plain_text'),
('node', 'article', 0, 3, 3, 'und', 0, '[Article original](http://greenash.net.au/thoughts/2012/06/introducing-the-drupal-handy-block-module/)\r\n\r\n## Introducing the Drupal Handy Block module \r\n\r\nExemple d''implémentation\r\n\r\n**Fichier template.php**\r\n\r\n    /**\r\n     * hook_handyblock()\r\n     */\r\n    function kbglasshouse_handyblock() {\r\n        return array(\r\n            ''recent_kbglasshouse_entries'' => array(\r\n                ''block_info'' => t(''Recent Knowledge Base entries'')\r\n            ),\r\n        );\r\n    }\r\n\r\n    /**\r\n     * Handy Block alter callback for block ''recent_kbglasshouse_entries''.\r\n     */\r\n    function kbglasshouse_handyblock_recent_kbglasshouse_entries_alter(&$block, $context) {\r\n      $nodes = _kbglasshouse_node_get_recent();\r\n      if (!empty($nodes) && is_array($nodes)) {\r\n          foreach ($nodes as $node) {\r\n              //$vars = tpl_field_vars($node);\r\n              $block[''content''][''#nodes''][] = array(''title'' => $node->title, ''url'' => ''node/'' . $node->nid);\r\n          }\r\n      }\r\n      \r\n    //  $block[''content''][''#theme''] = ''kbglasshouse_recent_kbglasshouse_entries'';\r\n    }\r\n\r\nOn peut voir que j''ai essayé de forcer un template `kbglasshouse_recent_kbglasshouse_entries` mais ça n''a pas marché.\r\nIl n''est apparemment pas possible pour l''instant de préfixer le nom du template du bloc autrement que par `handyblock_`\r\n\r\n**Fichier handyblock-recent-kbglasshouse-entries.tpl.php**\r\n\r\n    <?php if (!empty($nodes)) : ?>\r\n    <ul class="<?php print $classes; ?>">\r\n    <?php foreach ($nodes as $node) : ?>\r\n    <li><?php print l($node[''title''], $node[''url'']); ?></li>\r\n    <?php endforeach; ?>\r\n    </ul>\r\n    <?php endif; ?>\r\n\r\n\r\n\r\n', '', 'plain_text'),
