('node', 'article', 0, 6, 6, 'und', 0, '## .DIFF & .PATCH \r\n\r\nIl est possible d''afficher la version texte type "diff" ou "patch" de n''importe quel commit, compare, pull request en suffixant l''url d''un `.diff` ou `.patch`\r\n\r\nExemple avec ce commit :\r\n\r\n[7a59b3f9902211006d0652373458309f5ae8e5a8](https://github.com/Glasshouse/GH_KnowledgeBase/commit/7a59b3f9902211006d0652373458309f5ae8e5a8) en version [diff](https://github.com/Glasshouse/GH_KnowledgeBase/commit/7a59b3f9902211006d0652373458309f5ae8e5a8.diff)  et en version [patch](https://github.com/Glasshouse/GH_KnowledgeBase/commit/7a59b3f9902211006d0652373458309f5ae8e5a8.patch)\r\n\r\n## Retirer les espaces blancs et fins de ligne d''un diff\r\n\r\nParfois dans un diff, il y a des différences qui ne sont dûes qu''à des espaces blancs ou des fins de lignes en plus ou en moins. Pour les éliminer du diff et le rendre plus lisible, il suffit d''ajouter un paramètre d''url `?w=1`\r\n\r\nExemple de [version illisible](https://github.com/Glasshouse/Movenpick/commit/4ce75514c43fba7d580b6b160c6168cbc979be3f#diff-2) et ici [la version lisible](https://github.com/Glasshouse/Movenpick/commit/4ce75514c43fba7d580b6b160c6168cbc979be3f?w=1#diff-2)', '', 'plain_text'),
('node', 'article', 0, 8, 8, 'und', 0, 'Si vous obtenez l''erreur suivante en essayant d''utiliser le script doctrine via la ligne de commande (entre autre) :\r\n\r\n    [InvalidArgumentException]\r\n    The helper "em" is not defined.\r\n\r\nC''est que vous n''utilisez pas le bon script. Il faut en réalité utiliser le script `doctrine-module` qui se trouve dans votre répertoire `vendor/bin`\r\n', '', 'plain_text'),
('node', 'article', 0, 9, 9, 'und', 0, '[Article original](http://lostechies.com/keithdahlby/2011/04/06/windows-git-tip-hide-carriage-return-in-diff/)\r\n\r\n**Pour que l''outil diff ignore les caractères de fin de ligne**\r\n\r\n`git config --global core.whitespace cr-at-eol`\r\n\r\n**Cet article n''est pas complet**', '', 'plain_text'),
('node', 'article', 0, 10, 10, 'und', 0, '[Article original](http://bavotasan.com/2009/check-if-a-number-is-even-or-odd-with-php/)\r\n\r\nGrace à un test binaire ! Simple et efficace !\r\n\r\n    <?php\r\n        $num = 13;\r\n        if($num&1) {\r\n            echo ''The number is odd.'';\r\n        } else {\r\n            echo ''The number is even.'';\r\n        }\r\n    ?>\r\n\r\n', '', 'plain_text'),
('node', 'article', 0, 11, 11, 'und', 0, '#Ingrédients de base pour un emailing réussi :#\r\n\r\n**Début du code HTML :**\r\n\r\n    <!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN"\r\n    "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n    <html xmlns="http://www.w3.org/1999/xhtml">\r\n    <head>\r\n    <title>Titre de l''emailing (pour la version miroir)</title>\r\n\r\n**Encodage Western Europe : attention aux balises "alt" qui doivent être correctement encodées**\r\n\r\n    <meta http-equiv="Content-Type" content="text/html; charset=iso-8859-1" />\r\n\r\n**CSS de base :**\r\n\r\n    <style type="text/css">\r\n    td img {display: inline-block;border:0;margin:0;}\r\n    body {\r\n    	background-color: #fff;\r\n    	-webkit-text-size-adjust:none\r\n    }\r\n    .ReadMsgBody { width: 100%}\r\n    .ExternalClass {width: 100%}\r\n    table,p,li{line-height:13px;margin-bottom:5px;font-family:Arial, Helvetica, sans-serif;font-size:12px;font-weight:normal;color:#4c4c4c}\r\n    a:hover {text-decoration:underline}\r\n    .ReadMsgBody { width: 100%;}\r\n    .ExternalClass {width: 100%;}\r\n    li{margin:0}\r\n    </style>\r\n    </head>\r\n\r\n**Juste après le HEAD et l''ouverture du BODY, encapsuler le TABLE du mailing dans un TABLE qui le centre :**\r\n\r\n    <body bgcolor="#ffffff">\r\n    <table width="100%" height="100%" cellspacing="0" cellpadding="0" border="0" bgcolor="#ffffff">\r\n        <tbody>\r\n            <tr>\r\n                <td valign="top" align="center">\r\n                **TABLE DU MAILING**\r\n                </td>\r\n            </tr>\r\n        </tbody>\r\n    <table>\r\n\r\n**Tous les TD doivent être :**\r\n\r\n`<td valign="top" >`\r\n\r\n**Toutes les images doivent être :**\r\n\r\n`<img style="display:block;margin:0;padding:0" />`\r\n\r\n**Le chemin des images doit être absolu :**\r\nvers un http://....\r\n\r\n**Remplacer les images unies** par un bgcolor sur le TD et remplacer le jpg par `spacer.gif`en conservant ses dimensions.', '', 'plain_text'),
('node', 'article', 0, 13, 13, 'und', 0, 'En voulant étendre un élément input de type file, je me suis rendu compte qu''il était compliqué de changer le rendu d''un élément de formulaire dans ZF2.\r\n\r\nJ''ai trouvé la solution [ici](https://gist.github.com/4113974/34a762168ba87bf96297f429706a545fed99b6d3)\r\n\r\nDonc il m''a fallu étendre le VIew Helper FormElement pour pouvoir injecter mes propres Form View Helpers.\r\n\r\n[Voir l''implémentation](https://gist.github.com/4113974/34a762168ba87bf96297f429706a545fed99b6d3)\r\n\r\nDans les templates, je remplace les `$this->formElement($element)` par `$this->exFormElement($element)`.\r\nCa se comporte exactement pareil pour les éléments de base mais ça permet d''ajouter des éléments personnalisés avec leur propre View Helper.\r\n\r\nLes éléments doivent implémenter l''interface `ExFormElementInterface` et donc fournir la méthode `getViewHelperName` qui retourne le nom du View Helper qui va s''occuper du rendu de l''élément.\r\n\r\nEt voici un exemple d''élément personnalisé avec son view helper\r\n\r\n**Admin/Form/View/Helper/FormFile.php**\r\n\r\n    <?php    \r\n    namespace Admin\\Form\\View\\Helper;\r\n    \r\n    use Zend\\Form\\ElementInterface;\r\n    use Zend\\Form\\View\\Helper\\FormFile as ZendFormFile;\r\n    \r\n    class FormFile extends ZendFormFile\r\n    {\r\n        public function render(ElementInterface $element)\r\n        {\r\n            $render = parent::render($element);    \r\n            $escape     = $this->getEscapeHtmlAttrHelper();\r\n            $render .= ''<img src="'' . $escape($element->getValue()) .  ''" />'';    \r\n            return $render;\r\n        }\r\n    }           \r\n  \r\n**Admin/Form/Element/File.php**\r\n\r\n    <?php\r\n    namespace Admin\\Form\\Element;\r\n    \r\n    use Admin\\Form\\View\\Helper\\ExFormElementInterface;\r\n    use Zend\\Form\\Element\\File as ZendFormElementFile;\r\n    \r\n    class File extends ZendFormElementFile implements ExFormElementInterface\r\n    {\r\n        public function getViewHelperName()\r\n        {\r\n            return ''Admin\\Form\\View\\Helper\\FormFile'';\r\n        }\r\n    }\r\n\r\n', '', 'plain_text'),
('node', 'article', 0, 16, 16, 'und', 0, 'Parfois, on voudrait mettre de côté (stash) des modifs mais pas toutes les modifs déjà effectuées, seulement certains fichiers.\r\n\r\nIl est possible d''indexer les fichiers qu''on veut garder (git add) puis d''utiliser la commande `git stash --keep-index`\r\n\r\nAinsi ne seront mis en stash que les fichiers modifiés non indexés.\r\n\r\nEnsuite, on peut si nécessaire désindexer les fichiers indexés pour pouvoir continuer de les modifier avant commit.\r\n\r\n*(l''outil "Git Gui" fourni avec Git for Windows est particulièrement pratique pour cela d''ailleurs, on peut facilement indexer/désindexer des fichiers)*\r\n\r\n[source](http://stackoverflow.com/questions/3040833/how-to-stash-only-one-file-out-of-multiple-files-that-have-changed)', '', 'plain_text'),
('node', 'bookmark', 0, 18, 18, 'und', 0, 'Small library to provide some basic geo functions. Contribute to Geolib development by creating an account on GitHub.', '', 'plain_text'),
('node', 'article', 0, 19, 19, 'und', 0, '[Article original](http://enpause.fr/dev/csv-mysql.php)\r\n\r\nC''est vraiment bien plus rapide que l''import via phpmyadmin.Très utile pour les gros fichiers qui passent pas via pma.\r\n\r\n    LOAD DATA INFILE ''e:/tmp/import_combinaisons_cartes.csv''\r\n    INTO TABLE `combinaisons`\r\n    FIELDS\r\n    TERMINATED BY '',''\r\n    OPTIONALLY ENCLOSED BY ''"''\r\n    IGNORE 1 LINES\r\n    (@dummy, code1, code2, code3, grille);\r\n    \r\n    \r\n    LOAD DATA INFILE ''e:/tmp/import_combinaisons_emails.csv''\r\n    INTO TABLE `combinaisons`\r\n    FIELDS\r\n    TERMINATED BY '',''\r\n    OPTIONALLY ENCLOSED BY ''"''\r\n    IGNORE 1 LINES\r\n    (@dummy, code1, code2, code3, grille);\r\n\r\n', '', 'plain_text'),
('node', 'article', 0, 23, 23, 'und', 0, '    **The autoloader expected class** "Cgpe\\CmsBundle\\Repository\\OffresRepository"** to be defined in file** "F:\\Dropbox\\BOULOT\\wampwww\\cgpe/src/\\Cgpe\\CmsBundle\\Repository\\OffresRepository.php". \r\n    **The file was found but the class was not in it, the class name or namespace probably has a typo.**\r\n\r\nLes quelques fois où ça m''est arrivé et où il n''y avait pas de typo dans le nom de la classe, c''était parce que j''avais oublié d''ajouter le namespace.\r\n\r\n', '', 'plain_text'),
