('node', 'article', 0, 26, 26, 'und', 0, 'Pour lancer un test de charge il faut :\r\n\r\n1 - Modifier les préférences de son browser qui va enregistrer les scenarii de test en lui donnant comme proxy l''adresse IP du serveur sur lequel TSUNG est installé avec le port 8090 (à moins que cela ait été modifié lors de l''installation de TSUNG)\r\n\r\n2 - Se connecter au serveur via SSH pour lancer l''enregistrement en tapant la commande : `$ tsung-recorder start` Cette commande retourne le nom et le path du fichier dans lequel l''enregistrement va se faire ( si on lance TSUNG en root c''est par exemple /root/.tsung/tsung_recorder20122102-1212.xml (20122102 étant la date courante et 1212 l''heure du test)\r\n\r\n3 - On applique le scénario de test avec le browser sur le site.\r\n\r\n4 - Une fois l''enregistrement du scénario est fini (avec le browser), on arrête le test sur le serveur avec la commande `$ tsung-recorder stop` Le fichier de scénario (/root/.tsung/tsung_recorder20122102-1212.xml) liste toutes les actions faites via le browser et  ressemble à :\r\n\r\n    <session name=''rec20130429-1415'' probability=''100''  type=''ts_http''>\r\n    <request><http url=''http://www.microsoft.fr/'' version=''1.1'' method=''GET''></http></request>\r\n    <request><http url=''http://www.microsoft.com/fr-fr/default.aspx'' version=''1.1'' method=''GET''></http></request>\r\n    <thinktime random=''true'' value=''7''/>\r\n    <request><http url=''http://c.microsoft.com/trans_pixel.aspx?</request>\r\n    </session>\r\n\r\n\r\n5 - On récupérer le template de fichier de test dans /usr/share/doc/tsung/examples/http_simple.xml\r\n\r\n5.1 - On insère les tags du fichier de scénario dans la section <sessions> du fichier http_simple.xml \r\n\r\n5.2 - On modifie les tags <clients> qui permet de définir le nombre de clients simultanés et <load> qui permet de définir comment les clients arrivent sur le serveur (pour les autres tags voir la doc), comme par exemple : \r\n\r\n      <clients>\r\n        <client host="localhost" maxusers=''''500'''' use_controller_vm="true"/>\r\n      </clients>\r\net\r\n\r\n      <load>\r\n      	 <arrivalphase phase="1" duration="10" unit="minute">\r\n         		<users interarrival="2" unit="second"></users>\r\n       	</arrivalphase>\r\n      </load>\r\n\r\n\r\n6 - Si on a enregistré le fichier de test dans /root/tsung_test.xml, on va lancer le test avec la commande :\r\n`$ tsung -f tsung_test.xml start` cela va créer dans .tsung/log/ un répertoire sous le nom de la date courante 20122102-1546 dans laquel est enregistré le log du test .... laisser tester ...\r\n\r\n7 - A la fin du test on se place dans le répertoire de log du test avec $ cd .tsun/log/XXXXXX puis on lance le convertisseur du fichier log en fichier html avec la commande  `$ /usr/lib/tsung/bin/tsung_stats.pl` Cette commande va générer les fichiers et les images des tests dans .tsung/log/XXXXX. \r\n\r\n8 - Soit on récupère ce dossier XXXX pour une édition locale du résultat via report.html où dans les répertoire Apache accessible dur le serveur.', '', 'plain_text'),
('node', 'article', 0, 25, 25, 'und', 0, 'Installation sur une Debian en root :\r\n\r\n    $ apt-get update\r\n    $ apt-get install erlang erlang-nox\r\n    $ wget http://tsung.erlang-projects.org/dist/debian/tsung_1.4.2-1_all.deb\r\n    $ dpkg -i tsung_1.4.2.-1_all.deb\r\n    $ apt-get install gnuplot\r\n    $ perl -MCPAN -eshell # on se retrouve dans le shell CPAN taper en suite : install Template puis exit\r\n\r\n\r\nP.S si la machine doit être utilisée par d''autres utilisateurs penser à installer un serveur SSH et FTP et aussi Apache.\r\n\r\n[http://tsung.erlang-projects.org/ ](http://tsung.erlang-projects.org/ )', '', 'plain_text'),
('node', 'article', 0, 27, 27, 'und', 0, 'Il y a trois comptes développeur qui sont des comptes Unix sur la machine : benoit (password: benoit), paul (password paul) et fred (password fred). A chacun des comptes correspond un VHOST qui sont respectivement : paul.debian-server.vbox, benoit.debian-server.vbox, fred.debian-server.vbox modifiables via /etc/apache2/sites-available. Le Remote Xdebug est activé (voir restrictions plus bas pour l''utilisation de Frameworks).\r\n\r\nPour le développement avec NetBeans, il faut ouvrir nouveau projet -> PHP -> Remote Server puis suivre la procédure. Il est important de définir une connexion SFTP pour la synchronisation des fichiers locaux etdistants, lors de la création de la connexion il faut  pas oublier de choisir le protocole SFTP (FTP par défaut) et de bien donner comme répertoire de base /home/nom_utilisateur.  \r\n\r\nN.B. Dans le cas de l''utilisation d''un framework (qui fait pointer la première requête sur le serveur dans un répertoire particulier) pour que Remote XDebug fonctionne, il est INDISPENSABLE de :\r\n\r\n1) modifier le paramètre Web Root du projet dans NetBeans : click droit sur l''icone du projet dans l''ongle project -> properties -> Web Root -> click sur bouton Browse puis sélection du répertoire dans lequel doit arriver la requête (le routeur).\r\n\r\n2) modifier leVHOST de Apache comme par exemple : `$ sudo nano /etc/apache2/sites-avalaible/benoit`\r\nEnsuite modifier la directive` <Directory>` et `<DocumentRoot>` pour le faire pointer sur le répertoire initial, puis\r\n`$ sudo /etc/init.d/apache2 reload`', '', 'plain_text'),
('node', 'article', 0, 29, 29, 'und', 0, 'Pour savoir quelle est le constructeur de la carte utilisée pour le RAID, on tape la commande `# lshw` ( si le package n''est pas installé alors `# apt-get install lshw` on obtient une liste de composants du serveur et on cherche dans la section storage comme par exemple :\r\n\r\n    *-storage\r\n       description: RAID bus controller\r\n       product: MegaRAID SAS 2108 [Liberator]\r\n\r\nSurveiller le RAID avec une carte MageRaid LSI, les 3 commandes utiles sont :\r\n\r\n`# MegaCli -PDList -aALL`  Elle doit retourner un champ  `Firmware state: Online`\r\n\r\n`#  MegaCli -LDInfo -Lall -aALL` Elle doit retourner un champ  `State: Optimal`\r\n\r\n`# MegaCli -AdpAllInfo -aAll` Elle doit inclure `Degraded : 0`  et  `Offline : 0` dans la section `Device Present`\r\n\r\nLiens utiles pour MEGARAID  : http://artipc10.vub.ac.be/wordpress/2011/09/12/megacli-useful-commands/  et http://www.sophony.com/blog/carte-megaraid-chez-ovh-sur-debian-squeeze/ ', '', 'plain_text'),
('node', 'article', 0, 28, 28, 'und', 0, 'La VM est sur Stef-PC. Elle boote sur le réseau avec l''adresse 192.168.1.46 (éventuellement garantir que son adresse soit fixe via le routeur) et le domaine debian-server.vbox. Elle n''est donc accessible que sur le réseau de Bompas.\r\n\r\nC''est une Debian 6 LAMP avec SSHd, VSFTPd, phpMyAdmin ( http://debian-server.vbox/phpmyadmin - admin/admin) et MongoDB/Driver PHP avec rockmongo  (http://debian-server.vbox/rockmongo - admin/admin). La page http://debian-server.vbox rappelle les liens et les mot de passe pour phpMyAdmin et pour rockmongo .\r\n\r\nLes comptes sur le serveur sont : benoit (password: benoit), paul (password: paul) et fred (password: fred) et stefan (password: stefan). Ils ont accès à la machine en SSH et en SFTP. Tous ces comptes peuvent utiliser sudo ... en cas d''installation majeure mieux vaut cloner la machine avant ou prendre un instantanée.', '', 'plain_text'),
('node', 'article', 0, 30, 30, 'und', 0, '- Télécharger les sources PHP\r\n- Compiler les sources : configure, make, make install\r\n\r\nLes options de compilation par défaut des paquets php-ovh\r\n\r\n> ''./configure'' ''--disable-cli'' ''--disable-discard-path'' ''--disable-force-cgi-redirect'' ''--prefix=/usr/local/php5'' ''--with-config-file-path=/usr/local/lib/php5'' ''--with-pear=/usr/share/php5'' ''--enable-exif'' ''--enable-ftp'' ''--enable-bcmath'' ''--enable-calendar'' ''--with-gd'' ''--enable-gd-native-ttf'' ''--with-freetype-dir'' ''--with-gettext'' ''--with-zlib-dir'' ''--with-imap'' ''--with-imap-ssl'' ''--with-png-dir=/usr'' ''--with-jpeg-dir=/usr'' ''--with-xpm-dir=/usr'' ''--with-openssl'' ''--with-kerberos'' ''--enable-sysvsem'' ''--enable-sysvshm'' ''--with-mcrypt'' ''--with-iconv'' ''--enable-mbstring=all'' ''--enable-mbregex'' ''--with-mysql=/usr'' ''--with-mysqli'' ''--with-curl'' ''--with-pdo-mysql'' ''--enable-soap'' ''--enable-zip'' ''--with-pspell'' ''--with-mhash'' ''--with-xsl''\r\n\r\nModifier le `--prefix` et le  `--with-config-file-path`, éventuellement le `--with-pear` s''il s''agit d''une montée en version importante (exemple rajouter une version 5.4).\r\nEnsuite, personnaliser les options/modules que vous souhaitez.\r\nPersonnellement, j''ai été confronté au besoin de recompiler PHP pour y ajouter le module Intl nécessaire à la bonne exécution du framework Symfony 2. J''ai donc rajouté un `--enable-intl` aux options de compilation.\r\n\r\nAjouter un handler dans le fichier `/usr/local/etc/suphp.conf`. Ici on rajoute une version compilée de php v.5.3.16\r\n\r\n    [handlers]\r\n    ;Handler for php-scripts\r\n    x-httpd-php4=php:/usr/local/php4/bin/php\r\n    x-httpd-php5=php:/usr/local/php5/bin/php\r\n    x-httpd-php53=php:/usr/local/php53/bin/php\r\n    x-httpd-php5316=php:/usr/local/php5316/bin/php\r\n\r\n\r\nMaintenant, dans le fichier de config apache `/etc/httpd/httpd.conf` vous pouvez définir votre nouvel handler php et l''associer à un virtual host par exemple.\r\n\r\nNe pas oublier d''ajouter la ligne suivante dans `httpd.conf`  !!!\r\n\r\n    suPHP_AddHandler x-httpd-php5316\r\n\r\nEt dans la config du virtualhost\r\n\r\n    <VirtualHost *:80>\r\n        [...]\r\n        AddHandler x-httpd-php5316 .php\r\n    </VirtualHost>\r\n\r\n', '', 'plain_text'),
('node', 'article', 0, 32, 32, 'und', 0, 'Voici la méthode qui m''a permis de résoudre le problème:\r\n\r\nhttps://gist.github.com/fnichol/867550\r\n\r\nA noter, j''ai dû ajouter manuellement la variable d''environnement le script automatique n''ayant pas fonctionné. J''ai aussi installé le certificat dans le répertoire de Ruby et non pas dans Rail Installer', '', 'plain_text');
