(1, 'node', ' accueil bonjour et bienvenue sur la base de connaissance de glasshouse ', 0),
(2, 'node', ' how to change a git submodule url article original let yourproject be your git working directory supercoolib the submodule and yourusername your github username open with an editor of your choice in my case emacs the gitmodules file usually is located at the root of the repo cd yourproject emacs gitmodule you should see something like this submodule supercoolib path lib supercoolib url https githubcom anotherusername supercoolibgit change the url of the repo like that submodule supercoolib path lib supercoolib url https githubcom yourusername supercoolibgit now tell git to update his internal reference git submodule sync and then init if you didn t already and update the submodules git submodule init git submodule update don t forget to checkout the branch inside the submodule remember submodules have a detached head cd lib supercoolib git checkout master check if everything is working and finally commit your changes  git tip git ', 0),
(3, 'node', ' des blocks plus facilement avec drupal 7 et le module handyblock article original introducing the drupal handy block module exemple d implémentation fichier templatephp  hookhandyblock function kbglasshousehandyblock return array recentkbglasshouseentries array blockinfo t recent knowledge base entries handy block alter callback for block recentkbglasshouseentries function kbglasshousehandyblockrecentkbglasshouseentriesalt block context nodes kbglasshousenodegetrecent if empty nodes isarray nodes foreach nodes as node vars tplfieldvars node block content nodes array title node title url node node nid block content theme kbglasshouserecentkbglasshouseentries on peut voir que j ai essayé de forcer un template kbglasshouserecentkbglasshouseentries mais ça n a pas marché il n est apparemment pas possible pour l instant de préfixer le nom du template du bloc autrement que par handyblock fichier handyblockrecentkbglasshouseentriestplphp  php if empty nodes ul class php print classes php foreach nodes as node li php print l node title node url li php endforeach ul php endif  drupal drupal 7 handyblock drupal ', 0),
(4, 'node', ' se simplifier la vie avec les thèmes pour drupal grace au module template fields variables article original drupal drupal 7 drupal ', 0),
(5, 'node', ' le html ne se parse pas avec des expressions régulières pauvre fou  article original html expressions régulières tips inclassable ', 0),
(6, 'node', ' astuces github diff patch il est possible d afficher la version texte type diff ou patch de n importe quel commit compare pull request en suffixant l url d un diff ou patch exemple avec ce commit  7a59b3f9902211006d0652373458309f5ae8e5a8 en version diff et en version patch retirer les espaces blancs et fins de ligne d un diff parfois dans un diff il y a des différences qui ne sont dûes qu à des espaces blancs ou des fins de lignes en plus ou en moins pour les éliminer du diff et le rendre plus lisible il suffit d ajouter un paramètre d url w 1 exemple de version illisible et ici la version lisible git github git ', 0),
(7, 'node', ' site de dev secrets de gourmets  http devmoevenpick2012glasshousefr  ', 0),
(8, 'node', ' utilisation de doctrine en ligne de commande avec zf2 et et le module doctrineorm si vous obtenez l erreur suivante en essayant d utiliser le script doctrine via la ligne de commande entre autre invalidargumentexception the helper em is not defined c est que vous n utilisez pas le bon script il faut en réalité utiliser le script doctrinemodule qui se trouve dans votre répertoire vendor bin doctrine ligne de commande zend framework 2 ', 0),
(9, 'node', ' les paramètres utiles pour configurer git article original pour que l outil diff ignore les caractères de fin de ligne git config global corewhitespace crateol cet article n est pas complet git ', 0),
(10, 'node', ' vérifier qu un nombre est pair ou impair en php article original grace à un test binaire simple et efficace php num 13 if num 1 echo the number is odd else echo the number is even  php ', 0),
(11, 'node', ' emailings règles de base ingrédients de base pour un emailing réussi  début du code html   doctype html public w3c dtd xhtml 10 transitional en http wwww3org tr xhtml1 dtd xhtml1transitionaldtd html xmlns http wwww3org 1999 xhtml head title titre de l emailing pour la version miroir title  encodage western europe attention aux balises alt qui doivent être correctement encodées  meta httpequiv contenttype content text html charset iso88591  css de base   style type text css td img display inlineblock border  margin  body backgroundcolor fff webkittextsizeadjust none readmsgbody width 100 externalclass width 100 table p li lineheight 13px marginbottom 5px fontfamily arial helvetica sansserif fontsize 12px fontweight normal color 4c4c4c a hover textdecoration underline readmsgbody width 100 externalclass width 100 li margin  style head  juste après le head et l ouverture du body encapsuler le table du mailing dans un table qui le centre   body bgcolor ffffff table width 100 height 100 cellspacing  cellpadding  border  bgcolor ffffff tbody tr td valign top align center table du mailing td tr tbody table  tous les td doivent être   td valign top  toutes les images doivent être   img style display block margin  padding   le chemin des images doit être absolu  vers un http  remplacer les images unies par un bgcolor sur le td et remplacer le jpg par spacergif en conservant ses dimensions best practices css ', 0),
(12, 'node', ' astuce pour activer l extension intl pour php sous wamp http blogsmanomykingdomin enableintlextension  ', 0),
(13, 'node', ' custom form element view helpers en voulant étendre un élément input de type file je me suis rendu compte qu il était compliqué de changer le rendu d un élément de formulaire dans zf2 j ai trouvé la solution ici donc il m a fallu étendre le view helper formelement pour pouvoir injecter mes propres form view helpers voir l implémentation dans les templates je remplace les this formelement element par this exformelement element ca se comporte exactement pareil pour les éléments de base mais ça permet d ajouter des éléments personnalisés avec leur propre view helper les éléments doivent implémenter l interface exformelementinterface et donc fournir la méthode getviewhelpername qui retourne le nom du view helper qui va s occuper du rendu de l élément et voici un exemple d élément personnalisé avec son view helper admin form view helper formfilephp  php namespace admin form view helper use zend form elementinterface use zend form view helper formfile as zendformfile class formfile extends zendformfile public function render elementinterface element render parent render element escape this getescapehtmlattrhelper render img src escape element getvalue return render  admin form element filephp  php namespace admin form element use admin form view helper exformelementinterface use zend form element file as zendformelementfile class file extends zendformelementfile implements exformelementinterface public function getviewhelpername return admin form view helper formfile  zend framework 2 ', 0),
