(33, 2, 'Web Performance', 'Concerne l''ensemble des moyens pour améliorer la performances des applications Web', 'plain_text', 0, 'und', 0),
(34, 2, 'Liens', 'https://groups.diigo.com/group/web-performance/ - Groupe de dicussion   \r\nhttps://groups.google.com/forum/?fromgroups#!forum/performance-web - Groupe de discussion   \r\nhttp://www.phpied.com/category/performance/ - Blog   \r\nhttp://www.stevesouders.com/ - Blog   \r\nhttp://www.sergeychernyshev.com/ - Blog    \r\nhttp://www.sultansofspeed.com/ - Liste de blog\r\nhttp://en.wikipedia.org/wiki/Web_performance_optimization - Définition\r\nhttp://checklists.opquast.com/webperf  - Best pratices  \r\nhttp://www.hongkiat.com/blog/ultimate-guide-to-web-optimization-tips-best-practices/ - Best pratices  \r\nhttps://github.com/edas/webperf-book - Projet de livre  \r\nhttp://developer.yahoo.com/performance/rules.html - Best pratices  \r\nhttps://developers.google.com/speed/docs/best-practices/rules_intro?hl=fr - Best Partices  \r\nhttp://velocityconf.com/   \r\nhttp://www.perfplanet.com/ - Best practices  \r\nhttp://www.mysqlperformanceblog.com/ - Blog\r\nhttp://www.astucesdewebmaster.com/architecture/optimiser-mysql-et-apache-356 - Blog\r\n', 'full_html', 100, 'und', 0),
(35, 2, 'Sommaire', 'La Web Performance ou Web Performance Optimization (WPO) est un champ d''investigation qui porte sur l''amélioration de la performance de l''ensemble des composants qui interviennent dans l''accès au Web, depuis le Web Stack, le réseau, le protocole HTTP, le browser et les applications côté serveur et côté client. \r\n\r\nL''amélioration des performances Web agit sur :  \r\n- le Web Stack, en cherchant à améliorer les performances du serveur et de ses composants (Httpd, BDD ...)   \r\n- le Browser , en cherchant à maximiser les performances du browser dans l''accès au applications Web   \r\n- le Réseau en minimisant le temps de transferts entre les clients et le (les) serveur(s)  \r\n- les Applications (côté client ou serveur) en définissant des best practices de programmation\r\n\r\nPour valider ces améliorations on utilise des test qui s''appuient sur des métriques et des outils.', 'plain_text', 0, 'und', 0),
(36, 2, 'Web Stack', 'La mesure des performances d''un Web Stack s''appuie sur une métrique et des outils de mesure. Les composants du Web Stack intervenant notablement dans les performances de l''ensemble sont :  \r\n- le serveur Web ou Httpd  \r\n- la base de données  \r\n- les scripts\r\n\r\nLa performances du Web Stack peut être aussi améliorée par l''utilisation de composants dédiés à l''amélioration des performances. Ces outils sont principalement :\r\n\r\n- memCached\r\n- APC\r\n- eAccelerator', 'plain_text', 1, 'und', 0),
(37, 2, 'Browser', '80% du temps d''une requête d''une page consiste à descendre les ressources (images, CSS ...) et 20% à récupérer la page HTML (http://www.yuiblog.com/blog/2006/11/28/performance-research-part-1/)', 'plain_text', 2, 'und', 0),
(38, 2, 'Réseau', 'CDN ...', 'plain_text', 3, 'und', 0),
