(53, 2, 'Outils Unix', 'Les outils de monitoring fournis avec Unix sont :\r\n\r\n<h2>top </h2>\r\n\r\n<h1>apachetop</h1>\r\n\r\n<h3>installation</h3>\r\n\r\nPermet de monitorer apache en temps "réel" ( voir  http://blog.up-link.ro/how-to-monitor-apache-traffic-in-real-time-with-apachetop/ ou http://www.tux-planet.fr/statistiques-apache-en-live-avec-apachetop/). S''installe avec : $apt-get install apachetop\r\n\r\n<h3>utilisation</h3>\r\n\r\nSe lance avec la commande  $ apachetop suivi du nom de fichier à surveiller : $ apachetop -d 1 -f /var/log/apache2/access.log \r\n\r\n<h3>indicateurs</h3>\r\n\r\nLes indicateurs pertinents sont les réponses retournées en 2XX, 3XX ou 4XX. Il faut surveiller les 4XX \r\n\r\n<h2>tail </h2>', 'full_html', 0, 'und', 0),
(54, 2, 'Outils Windows', '', 'plain_text', 1, 'und', 0),
(55, 2, 'Outils tiers Open Source', '', 'plain_text', 2, 'und', 0),
(56, 2, 'Outils tiers Payants', '', 'plain_text', 3, 'und', 0),
(57, 2, 'Modules', 'Quelque soit le mpm utilisé avec Apache, il faut veiller que les modules dynamiques chargés par Apache ne sont pas inutiles. Si c''est le cas ils peuvent être désactivés par la commande # a2dismod <nom_du_module>. Certains des modules sont compilés avec Apache (modules statiques) et dans le cas où Apache a été installé via un package, il faudra copiler Apache en spécifiant les modules que l''on souhaite garder.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'plain_text', 3, 'und', 0),
(58, 2, 'Outils Unix', 'ab (Apache Benchmark)\r\n\r\nDisponible dans le package apache2-utils voir (http://dev.petitchevalroux.net/linux/tester-son-serveur-http-linux.159.html) \r\non l''installe par un # apt-get install apache2-utils. On lance des tests avec la commande ab comme par exemple: \r\n\r\n# ab -n 10000 -c 30 http://exemple.com\r\n\r\nCette commande va envoyer 10000 requêtes non compressées donct 30 en parralèle vers l''url en fin de paramètres.\r\n\r\nATTENTION : ab est un outil adapté pour tester un script particulier parce qu''il ne simule pas une réelle utilisation. ab ne doit pas être lancé depuis le serveur qui sert de test car cela va fausser les résultats.\r\n\r\n.', 'plain_text', 0, 'und', 0),
(59, 2, 'Modules Apache', 'Le module mod_deflate permet de compresser les données transférées vers le browser, son utilisation peut être combinée avec un serveur de chache comme lighttpd.\r\n\r\nLe module mod_spdy peut permettre d''accèlerer les temps entre le browser et le serveur en utilisant un autre protocole que HTTP. Il est développé par Google et fonctionne donc avec Chrome.', 'plain_text', 0, 'und', 0),
(60, 2, 'Serveur de cache', 'Utiliser Squid ou Varnish', 'plain_text', 1, 'und', 0),
(61, 2, 'Serveur HTTP', 'Associer à Apache un serveur au traitement des pages statiques comme Nginx ', 'plain_text', 2, 'und', 0),
(63, 2, 'memcached', '', 'plain_text', 0, 'und', 0),
