(65, 2, 'MySQL', '', 'plain_text', 0, 'und', 0),
(85, 2, 'SPDY', '', 'plain_text', 0, 'und', 0),
(66, 2, 'MySQL', 'Optimiser MySQL exige d''obtenir des informations sur son fonctionnement. Ces données ne sont collectées par MySQL qu''à la suite d''un fonctionnement en conditions de production de quelques jours voire quelques semaines. Il faudra donc laisser fonctionner MySQL pendant un certain laps de temps avent de pouvoir obtenir des données  qui permettront de diagnostiquer son fonctionnement pour pouvoir l''améliorer.\r\n\r\nPour optimiser MySQL on va se pencher sur les aspects qui sont par importance :     \r\n\r\n<b> - le cache des données  </b>   \r\n<b> - le cache des thread  </b>   \r\n<b> - les buffers  </b>   \r\n<b> - les optimisations possibles par type de ''''storage engine'''' (MyISAM, InnoDB)  </b>   ', 'full_html', 1, 'und', 0),
(67, 2, 'Base de données', 'Objectif\r\n\r\nOn teste les scripts les plus actifs que la base de donnéespour trouver les problèmes de configuration et déclencher des erreurs comme “MySQL: ERROR 1040: Too many connections”. Ce problème vient de la configuration de MySQL.\r\n\r\nMéthode \r\n\r\nOn passe via des reqêtes HTTP qui appelent directement le script et qui poussent la montée en charge de l''accès à la base.\r\n\r\n', 'plain_text', 0, 'und', 0),
(68, 2, 'Moteurs', 'La structure de la base doit être pensée en terme de moteur (avantages et incovénients).   ', 'plain_text', 0, 'und', 0),
(69, 2, 'MyISAM', 'Il va plus vite particulièrement pour les SELECT. Son désavantage est qu''il Locke les tables sur lesquelles il fait des DELETE, INSERT ou UPDATE pendant toute la durée de la requête ce qui met les autres requêtes (incluant les SELECT) sur la même table en attente. Cela peut être un gros désavantage pour les sites des tables sont sollicitées à 90% en lecture et 10% en écriture car les SELECT seront sans cesse ralentis par des INSERT.\r\n\r\nIl permet de compresser les tables avec myisampack, elles sont compressées colonne par colonne sur un ratio de 50% vis à vis des tables non compressés cela permet d''accèder au données plus vite mais dans ce cas les table sont en Read-Only. Cette opération de packing est manuelle.\r\n\r\nDe plus le moteur MyISAM est le seul à permettre le full-text searching. ', 'plain_text', 0, 'und', 0),
(70, 2, 'InnoDB', 'La raison principale de sont utilisation au lieu de MyISAM est son support des transactions. Sa réputation de plus grande lenteur vis à vis de MyISAM a conduit à son utilisation pour des besoins bien spécifiques.   \r\nPour rappel les transactions qui font que plusieurs requêtes peuvent être exécutées atomiquement ce qui implique qu''elles sont toutes exécutée ou aucune est exécutée. L''exemple typique est celui d''une transaction bancaire avec le transfert d''un compte à l''autre qui peut être illustré par 2 requêtes :   \r\nUPDATE user1 SET balance=balance+100 ;   \r\nUPDATE user2 SET balance=balance-100 ;   \r\nCette transaction n''est réussie que si les deux requêtes sont réussies. La transaction logue ces requêtes et permet un roolback.    \r\nCe support des transactions à fait que Oracle l''a promu au moteur par défaut depuis MySQL 5.5. Le support des tables compressées a été ajouté et d''autres fonctions de tunning. Il est plus rapide sur la recherche des clés primaires (pas des clés secondaires mais cela peut être améliorer).    \r\nSur l''incovénient du locking des tables par MyISAM lors d''une écriture, InnoDB implémente un locking au niveau de la colonne et sur les tables qui ont des grosses charges d''écriture cela peut être un avantage.\r\nPar contre il ne supporte pas le recherche full-text.', 'plain_text', 1, 'und', 0),
(71, 2, 'MEMORY', 'Le moteur MEMORY ou HEAP charge une table entière en mémoire et permet un accès rapide. Comme MyISAM il ne supporte pas les transactions, les foreign keys et le row-level locking, il a aussi des incovénients spécifiques qui en limitent l''utilisation. Le contenu du moteur MEMORY ne persiste pas après un redémarrage et le limite à la conservation de données temporaires (classiquement les données de session) et il a aussi des limitations dans les types de colonnes car il ne supporte pas le type text ou blob. Les méthodes d''indexation peuvent être problématiques, MEMORY supporte le B-tree et les hash indexes et le premier est plus lent que le second. Mais dans le situations dans lesquelles il y beaucoup de valeurs d''index dupliquées les performances du hash index vont décroitre rapidement et B-tree devient la meilleure option.\r\nLa taille maximale d''une table MEMORY est limitée par la variable max_heap_table_size qui est par défaut de 16MB. \r\nDe plus la table MEMORY va occuper une taille de mémoire sur la base de colonnes de taille fix déterminées selon la taille de la colone la plus large et conduit logiquement à une surestimation des besoins en mémoire.  \r\n\r\nMEMORY est le seul moteur a offir des hash indexes. B-tree sont particulièrement adaptés au indexes de taille importante qu''il est difficile de stcoker en mémoire et pour cela ils sont stockés sur disque bein qu''optimisés pour requerir le minimum d''accès dique. B-tree est mieux adapté à des requêtes incluant des opérateurs de condition comme =>, <=, BETWEEN et aussi les préfixes comme LIKE. Les Hash Indexes sont moins flexibles mais plus rapides car au lieu de traverser la tree structure MySQL va directement à la valeur. Le B-tree est un meilleur choix pour les indexes volumineux qui ne peuvent pas être stockés en RAM. Les Hash tables sont plus rapides pour des volumes faibles d''indexes et seulement pour des test d''égalité.', 'plain_text', 2, 'und', 0),
(50, 2, 'Moteurs', 'Il existe deux "moteurs" (Multi Processing Modules) Apache sous Unix :     \r\n\r\n1) le mpm-prefork  - Inconvénients : gourmand en mémoire / Avantages : meilleure intégration des langages sous formes de modules (particulèrement PHP)\r\n\r\nN.B. L''avantage du mode prefork est de "préparer" la montée en charge avec les directives MaxSpareServers et  MaxRequestsPerChild (voir section Configuration), il faut donc les augmenter lorsque l''on prévoit de "brusque" montée en charge comme par exemple l''utilisation de requêtes Ajax.\r\n\r\n2) le mpm-worker  -  Inconvénients :  n''est pas compatibles avec certains modules Apache (dont le module PHP d''où l''obligation d''utiliser fcgid ou fastcgi) / Avantages : économe en mémoire. Par son modèle multithread Worker est mieux adapté au machines multiprocesseur.\r\n\r\nN.B. il existe aussi le event MPM (listé par la directive <IfModule mpm_event_module> dans apache2.conf - voir ci-dessous). C''est le "moteur" apache par défaut quand on vient à désinstaller mpm-worker ou mpm-prefork, il est réinstallé par Apache. Il fonctionne comme mpm-worker. \r\n\r\nLes "passerelles" applicatives (pour PHP et autres) fournies par Apache sont de deux types :  \r\n\r\n1) module - PHP est appelé via module intégré à Apache (à ses binaires), c''est le cas du module Apache pour PHP (mod-php5) . Dans ce cas le script PHP est placé dans le process Apache (si Apache a des failles de sécurité ... le script en hérite). Il est plus rapide que CGI car il ne charge qu''une seule fois l''interpréteur (d''où prefork !) et il est plus stable sous la charge (parceque géré par Apache). De plus la configuration du module peut être différenciée selon le besoin via les .htaccess ce qui n''est pas le cas de CGI qui ne peut modifier cette configuration que dans le script lui-même.   \r\n\r\n2) CGI - PHP est appelé via la passerelle applicative de type CGI (Common Gateway Interface) ou Fast CGI. Dans ce cas le processus pour traiter la reqête est hors de Apache, il s''appuie donc sur la sécurité du système. Par contre chaque processus lancé quite à une reqête fait un fork() de l''interpréteur, ce problème est résolu par Fast CGI. Concernant Fast CGI il existe deux portages : un portage Open Source (fcgid) et un portage commercial (fastcgi).  \r\n\r\nN.B Pour savoir quel module Apache utilise on utilise la commande : # apache2 -l\r\n\r\nQuand utiliser mpm-prefork ou mpm-worker ?  \r\n\r\n1) On écarte mpm-prefork immédiatement si on se trouve dans un cas où on doit utiliser des modules incompatibles avec mpm-prefork (non-thread-safe libraries) comme suPHP ou suEXEC qui doivent utiliser CGI ou dans le cas d''utilisation de CMS (WordPress exige l''utilisation de CGI pour des problèmes de sécurité liés à la mise à jour autoimatique des plugins ) ... dans ce cas la réponse est simple : on utilise mpm-worker + cgi + fcgid/fastcgi     \r\n\r\n2) Dans le cas où on peut utiliser mpm-prefork et que l''on dispose d''un serveur avec une RAM confortable, mieux vaut l''utiliser parce qu''il est plus robuste (légèrement plus rapide) que mpm-worker. ', 'plain_text', 0, 'und', 0),
(49, 2, 'Configuration', 'Pour obtenir de meilleures performances d''Apache, le fichier de configuration a toucher est /etc/apache2/apache2.conf (Debian flavors). On agira sur les directives suivantes selon que l''on utilise mama-prefork ou mpm-worker :\r\n\r\n1) Si on utilise mpm-prefork, on modifie la section ... , les directives à modifier sont :\r\n\r\nServerLimit – Cette directive ressemble à la directive MaxClients et les changements de l''une affecte l''autre. Lorsque lorsque l''on met à jour MaxClients il suffit de la mettre à jour avec un signal SIGHUP (reload) à Apache alors que la mise à jour de ServerLimit demande un restart complet. La raison est que ServerLimit permet à Apache de juger le montant de mémoire disponible à allouer au démarrage. Donc ServerLimit doit avoir la même valeur ou une valeur plus importante que MaxClients. En fait on la laissera un peu plus elvée en cas de redémarrage permettant de gérer plus de clients.\r\n\r\nTimeout : réglé par défaut à 300 (c’est à dire 5 minutes), ce seuil peut éventuellement être abaissé si vous rencontrez de gros problèmes de performances dus à des connexions très lentes qui encombrent votre serveur. En pratique, il n’y a pas de gain de performance à le modifier.\r\n\r\nKeepAlive On : il est recommandé d’utiliser cette fonctionnalité de la norme http1.1 qui permet de réutiliser une connexion ouverte pour envoyer plusieurs documents au même client. C’est notamment très utile pour permettre au navigateur de télécharger les images contenues dans une page en économisant l’ouverture de connexions successives. Il faut cependant faire attention aux réglages de MaxKeepAliveRequests et KeepAliveTimeout (ci-dessous) qui y sont liés, car dans certains cas, la fonctionnalité keepalive peut ralentir les performances d’un serveur web (avec des trafics lents, trop importants, ou en cas d’attaques délibérées). Dans des cas critiques (serveur qui s’effondre faute de mémoire) il peut être intéressant de suspendre momentanément cette fonctionnalité, le temps de rétablir la situation… Dans d’autres cas, cela ne fera qu’empirer les choses !\r\n\r\nMaxKeepAliveRequests : réglé par défaut à 100, vous pouvez abaisser ce seuil si vous avez besoin de faire “mourir” plus rapidement vos processus à la suite de fuites de mémoire, mais dans la plupart des cas vous n’avez pas intérêt à l’abaisser. Vous pouvez même l’augmenter un peu si vos pages contiennent beaucoup d’images, ou si vos utilisateurs font beaucoup de pages vues par visites, ou si vous procédez à des rechargements automatiques ou à des opérations se succédant rapidement en Ajax, etc. Vous ne risquez pas grand chose à l’augmenter à 150 par exemple.\r\n\r\nKeepAliveTimeout : réglé par défaut à 15 secondes, c’est en général beaucoup trop. Si vous n’avez pas de raison spécifique de vouloir maintenir artificiellement des connexions ouvertes avec vos clients pendant aussi longtemps, baissez ce seuil à 2 secondes. Si vous rencontrez des gros problèmes de charges, baissez-le provisoirement à 1 seconde.\r\n\r\nStartServers : réglé par défaut à 5, ce paramètre ne joue en pratique que lors des redémarrages du serveur web. Il n’a donc pas une grande importance. Vous pouvez l’augmenter si vous savez que votre serveur peut faire face à tout moment à des brusques pics d’audience, afin qu’il soit prêt à les affronter après un redémarrage. Il indique le nombre d’instances Apache simultané à lancer dès le redémarrage. Sachant qu’Apache s’occupera de lancer des instances supplémentaires s’il en faut plus.\r\n\r\nMinSpareServers : indique le nombre de processus Apache qu’il faut garder disponible à tout moment pour faire face aux variations de fréquentation, la limite étant de toute façon MaxSpareServers. Réglé par défaut à 5.\r\n\r\nMaxSpareServers : indique le nombre maximum de processus Apache inutilisés qu’on peut laisser en attente. Réglé par défaut à 10. Si vous rencontrez des problèmes de fuite mémoire, vous avez vraissemblablement intérêt à ne pas augmenter ce chiffre. Mais attention : si vous l’abaissez trop, votre serveur va passer son temps à “tuer” et à “recréer” des processus, ce qui va sensiblement augmenter la charge CPU et la charge serveur globale. Il faut donc toujours se ménager une marge de sécurité. Si vous n’avez pas de problème de mémoire, vous pouvez sensiblement augmenter ce nombre afin d’éviter de détruire des processus “pour le plaisir”, et de garder en permanence un maximum de serveurs prêts à répondre aux fluctuations de fréquentation.\r\n\r\nMaxClients : C’est le paramètre le plus important dans la configuration Apache ! En théorie, vous devez régler ce nombre en fonction de la mémoire moyenne utilisée par un de vos processus Apache et de la mémoire totale disponible pour Apache sur votre système. Malheureusement ce n’est pas toujours possible quand on travaille avec mod-php la réutilisation des processus a tendance à faire “gonfler” énormément la consommation mémoire des instances Apache, qui ne “rendent” la mémoire que quand elles s’éteignent. En pratique, les instances Apache ont donc tendance à consommer systématiquement la mémoire nécessaire à l’exécution de votre plus “gros” script PHP à tout moment. Voilà comment vos instances Apache/mod-php en viendront vite à consommer plusieurs centaines de mégaoctets chacune : si votre serveur n’a qu’un ou 2 Go de mémoire, vous devrez en théorie abaisser de façon draconienne ce paramètre MaxClients, qui est réglé par défaut à 150. Plus vos applications PHP sont “lourdes” (par exemple un CMS évolué comme WordPress ou un framework), plus vous allez devoir théoriquement réduire le nombre de clients acceptés en parallèle pour éviter la saturation mémoire, qui provoquerait immédiatement le swap sur disque et l’effondrement du serveur. En pratique les choses ne sont pas si simples : on peut “jongler” avec le nombre de clients acceptables, à condition de s’assurer que la mémoire absorbée par les processus Apache est régulièrement “purgée”. Pour cela, il faut réduire la réutilisation des processus, car en les obligeant à “mourir” plus souvent, on évite la fuite en avant permanente dans l’usage de la mémoire. Dans les cas critiques, afin de ne pas trop diminuer le nombre total de “slots” Apache disponibles pour accueillir les connexions, on peut être amené à entraver la réutilisation des processus (en abaissant le paramètre MaxRequestsPerChild abordé ci-dessous), ce qui va augmenter la charge CPU mais libérer beaucoup plus vite la mémoire. Si vos applications PHP sont “atypiques” ou asymétriques (avec quelques “gros scripts” PHP qui nécessitent beaucoup de mémoire mélangés à des traitements moins gourmands), cette solution peut vous sauver la mise. Il faudra à moyen terme envisager de dédier un serveur web à vos différents types de traitements (voir par exemple comment coupler Apache à NginX pour éviter d’utiliser Apache pour servir les fichiers statiques). En résumé : si vous avez des problèmes de saturation mémoire, il faut réduire considérablement le paramètre MaxClients, puis jouer sur le paramètre MaxRequestsPerChild pour voir jusqu’où vous arrivez à le remonter sans causer l’emballement de votre serveur… C’est un problème de gestion de risque… L''idée est que la valeur de MaxClients NE DEPASSE PAS la mémoire vive !!!\r\n\r\nOn "peut" calculer le MaxClients comme suit : M axClients = Mémoire Totale * 80% / Mémoire Max pour un process Apache. Si on se base sur une utilisation maximale d''un process Apache à 10MB (script le plus gourmand), on obtient dans le cas de 64Go de RAM, un peu plus de 5000 process donc clients.\r\n\r\nMaxRequestsPerChild : c’est l’autre paramètre fondamental si vous rencontrez des problèmes de mémoire. Si vous n’avez pas de problème d’utilisation de la mémoire par Apache, vous pouvez le laisser à son réglage par défaut (0), ce qui signifie que les processus n’expirent jamais ! Dès que vous rencontrez des problèmes de mémoire, même occasionnels, il faut régler ce paramètre différemment pour éviter les “fuites”. Si vous êtes à un stade critique, abaissez ce chiffre de façon draconienne (par exemple 10, voire moins). Une fois que votre serveur sera stabilisé en jouant sur d’autres paramètres (optimisation du code PHP, utilisation d’un cache d’opcode, répartition des statiques sur un autre serveur,…), vous pourrez remonter significativement ce chiffre (par exemple 1500), mais en évitant de le laisser à zéro pour être sur que sur le long terme il y ait un minimum de “rotation” dans l’usage de la mémoire : cela peut jouer énormément pour pérenniser la fiabilité de votre serveur web. Mieux vaut forcer les instances à redémarrer de temps en temps (c’est quasiment indolore sur des systèmes modernes), plutôt que de devoir redémarrer tout votre serveur une fois par mois après un crash suite à la saturation de la mémoire !\r\n\r\nHostnameLookups : sur un serveur chargé et que vous devez optimiser, laissez ce paramètre à Off. Si vous voulez vraiment résoudre les adresses IP de tous vos visiteurs, faites-le de façon asynchrone, sur un serveur de statistiques séparé de votre serveur de production.\r\n\r\nLogLevel warn : sur un serveur de production très chargé sur lequel de nombreux fichiers manquants viendraient par exemple à provoquer un volume très important d’erreurs, vous pourriez gagner à baisser le seuil de sensibilité du journal d’erreurs. Evitez de le désactiver complètement cependant, au risque de ne plus avoir aucune trace de ce qui ne tourne pas rond sur votre machine.\r\n\r\nEn conclusion :\r\n\r\nSi vous avez des problèmes de mémoire RAM : baissez le MaxClients, le MaxKeepAliveRequests, le KeepAliveTimeout, le MaxSpareServers et un indiquez un nombre relativement faible pour MaxRequestsPerChild : cela va faire baisser l’utilisation moyenne de la mémoire en forçant les processus à mourir plus souvent, en libérant leur mémoire. Mais cela va abaisser les performances globales et augmenter la charge CPU. Par rapport à un serveur qui sature sa mémoire et swappe sur le disque ou plante régulièrement, cela reste un moindre mal… au moins le temps de régler les problèmes à la source (optimisation du code PHP,…) Par ailleurs, vous pouvez avoir intérêt à réduire les performances de votre serveur web pour réserver de la mémoire à vos caches de base de données (si elles sont sur la même machine) ou d’opcode : au final, vous serez souvent gagnants si vos ressources sont limitées. Redémarrer un processus Apache “coûte” bien moins cher à votre système que de devoir recompiler à la volée un script PHP ou une requête MySql qui auraient pu être en mémoire…\r\n\r\nExemple d''une configuration mpm-prefork pour un serveur Xeon de 64Go de RAM avec SSD : ServerLimit 1200 StartServers 192 MinSpareServers 384 MaxSpareServers 768 MaxClients 1536 MaxRequestsPerChild 120000\r\n\r\n2) Si on utilise mpm-worker, on modifie la section ... , les directives à modifier sont :\r\n\r\nStartServers - C''est le nombre de child process crées au démarrage. Chaque server exécute des threads multiples pour taiter les demandes de connexion. Dans le cas ou le traffic est important on augemente cette directive.\r\n\r\nMinSpareThreads - C''est le nombre minimum de thread gardés en réserve dans l''attente de nouvelles connexions.\r\n\r\nMaxSpareThreads - C''est le nombre maximum de threads gardés en réserve en attente de nouvelles connexions\r\n\r\nThreadLimit - C''est la limite absolue des threads par process qui doit êtr eégal ou supérieur à la directive ThreadsPerChild\r\n\r\nThreadsPerChild - C''est le nombre de thread (de connexion) qui sera géré par chaque child process, quand un child process est lancé tous ses thread sont lancés aussi cela implique que les ressources comme la mémoire sont allouées pour toutes les connexions potentielles sur le child process. Cette valeur par défaut est de 25.\r\n\r\nMaxClients - C''est le nombre maximum de requêtes simultanées que Apache va gérer. Toutes les connexions au-delà de ce nombre seront placées dans une queue avant qu''un process soit libre pour la traiter. Il ne faut pas confondre MaxClients et les nombre d''utilisateur du site sachant qu''un utilisateur peut lancer plusieurs requêtes. Le temps d''attente pour la fin d''une connexion est donné par la directive KeepAliveTimeOut donc agir sur le timeout permet de libérer des process plus rapidement.', 'full_html', 1, 'und', 0),
(48, 2, 'Apache MPM Prefork', '<h3>Objectifs</h3>\r\n\r\nRéaliser des tests de charge pour l''estimation de la consommation des ressources par Apache (pour un site donné) en terme de disque, mémoire et CPU. Pour ne pas brouiller les résultats il est utile d''éviter de faire des requêtes sur une qualconque BDD car les baisses de performances de l''accès BDD vont être difficiles à séparer des baisses de perfomances globales.\r\n\r\n<h3>Méthode</h3>\r\n\r\nLa configuration de Apache vis à vis des montées en charges attendues se fait en 4 étapes :\r\n\r\n1 - On modifie les directives MaxClients et StartServer du fichier de configuration d''Apache en fonction des charges attendus<br>\r\n2 - On lance un test de charge<br>\r\n3 - On suit la consommation des ressources par Apache avec les outils de monitoring.<br>\r\n4 - Selon la qualité des résultats on agit sur le fichier de configuration d''Apache -> retour à l''étape 1<br>\r\n\r\n<h4>Etape 1</h4>\r\n\r\nOn détermine la mémoire "théorique" utilisée par Apache pour chaque process on peut utiliser la commande suivante : # ps -ylC apache2 –sort:rss permet de chercher le process le plus groumand en mémoire. (dans la colonne SZ). On calcule ensuite la directive <b>ClientsMax = 80% de la mémoire vive totale / Taille du process Apache le plus gourmand</b>. On va ensuite modifier MaxClients dans le fichier de configuration d''Apache et <b>on augmente la valeur de la directive ServerLimit à une valeur legèrement plus haute que celle de MaxClients </b>cela permet de pourvoir ensuite augmenter MaxClients sans avoir à redémarrer Apache mais par un simple reload parceque le changement de ServerLimit demande un redémarrage complet (restart) de Apache. On fait un restart de Apache. Ces directives sont particulièrement liées au Hardware de la machine donc on n''est pas susceptibles de les modifier à la suite des test. \r\n\r\nOtionnellement on peux :\r\n<li>Laisser <b>MaxRequestsPerChild</b> à 0 si on a pas de problème de mémoire, cela signifie que les processus ne meurent jamais (il sont réaffectés par Apache mais jamais détruit). Si on a des problèmes de mémoire et que la mémoire du serveur sature, il faudra le redémarre et ensuite il faudra augmenter cette valeur jusqu''à ne plus avoir de problèmes de mémoire.</li>\r\n<li>On augmenter à 150 le<b> MaxKeepAliveRequests</b> (à 100 par défaut) , si ce site contient beaucoup d''images ou d''appels Ajax ...</li>\r\n<li>Baisse la directive <b>KeepAliveTimeout</b> à 2 secondes (qui est à 15 secondes par défaut) à moins que l''on ait un site qui ait besoin de laisser les connexions ouvertes (lecture dun document, administration ...).</li>\r\n<li>La directive <b>MinSpareServers</b> concerne les process que doit lancer avant l''arrivée d''un quelconque traffic par Apache. Si on a un site qui est susceptible de monter rapidement en charge mieux vaut augmenter la valeur pour que Apache puisse démarrer rapidement. Cette directive a une limite supérieure donnée avec la directive <b>MaxSpareServers</b>. Si on a de la RAM disponible, il n''est pas inutile d''augmenter ces valeurs pour faire face à des fluctuation soudaine de fréquentation.</li>\r\n<li> Augmenter la variable <b>SendBufferSize</b> à une taille un peu plus importante que le poids maximum de la moyenne des pages. Cela a pour effet de pousser Apache à envoyer l''ensemble des éléments d''une page sans attendre un ACK du client.</li>\r\n<br>\r\n<h4>Etape 2</h4>\r\n\r\nOn lance un test de charge avec TSUNG (voir Test de charge / Tsung). Après avoir crée un scénario de consultation. \r\n\r\n<h4>Etape 3</h4> \r\n\r\nIl n''est pas conseillé d''agir sur le serveur pendant le test de charge (phpMyAdmin, munin ...). On lance les outils de monitoring <b>sur le serveur qui est testé</b> comme apachetop qui permet de lister le volume de requêtes et les entêtes HTTP renvoyés en surveillant les 4XX qui signifient que le serveur à un problème. un tail -f du fichier de log des erreur Apache permettent d''afficher d''éventuelles erreurs dans le code.\r\n\r\n<h4>Etape 4</h4> \r\n\r\nOn va diagnostiquer :\r\n\r\n<li>La réponse à la charge du serveur Apache, c''est à dire principalement les entêtes HTTP renvoyés et les 4XX ainsi que les courbes de comparaisons des nombres de requêtes et des nombres de connexions.</li>\r\n<li> L''utilisation des ressources grâce aux outils de diagnostic (munin par exemple) et on va </li><br>\r\n\r\n<h3>Conclusion</h3>\r\n\r\nA l''aide de l''outil de monitoring on va avoir des données qui permettent de conclure que :\r\n\r\n- Si on a une utilisation de la méoire trop importante, on agit sur les directives MaxRequestsPerChild (par défaut à 0, ce qui signifie que les process child de Apache ne meurent jamais) pour dimuniuer le temps de vie des process et libérer de la RAM. Si à l''inverse on a une utilisation trop importante de la CPU c''est peut-être parceque le MaxRequestsPerChild est trop important car la création/destruction des processus prend du temps CPU.\r\n\r\n- Si l’utilisation du disque dur est importante le problème ne vient pas d’Apache mais de l’application comme les scripts PHP à optimiser ou requêtes base de données trop lourdes (ou base de données trop volumineuse), par exemple.   \r\n\r\n- Si l’utilisation CPU qui est en cause, alors une partie peut venir de la création de nouveaux processus Apache au moment des pics de trafic, et on peut effectivement gagner en utilisant plus de mémoire, en laissant plus de processus Apache actifs à tout moment pour faire face aux connexions entrantes. Dans ce cas on jouera sur la réutilisation des processus en augmentant MaxRequestsPerChild et MaxKeepAliveRequests, et on pourra aussi augmenter MaxClients et MaxSpareServers.    \r\n\r\n', 'full_html', 0, 'und', 0),
(72, 2, 'ARCHIVE', 'Le moteur ARCHIVE ressemeble à MyISAM, les deux utilisent la compression et une lecture rapide. ARCHIVE supporte la compression zlib qui est meilleure que celle de MyISAM mais il ne supporte pas les indexes. Il support le row-level locking comme InnoDB', 'plain_text', 3, 'und', 0),
(73, 2, 'Cache Table', 'Le cache est l''aspect le plus important. Il améliore les performances en gardant les tables ouvertes (ce n''est pas plus qu''un file handle) en mémoire en éliminant le overhead lié à leur ouverture et fermeture. Il est donc conseillé de mettre l''ensemble des tables dans la cache même si cela n''est pas toujours possible. Quand le cache est plein et qu''un client tente d''accèder à une table qui n''est pas dans le cache un algorithme (Last Recently Used pour LRU) va supprimer la plus ancienne entrée dans le cache (en l''écrivant sur le disque) pour y placer celle qui concernen la reqûete. La commande FLUSH TABLES a le même effet puisqu''elle entraîne la suppression de toutes les tables dans le cache.   \r\n\r\nLe variable de my.cnf qui ont une impact directe sur la performance du site sont :   \r\n  \r\nLa variable <b>table_open_cache (ou table_cache)</b>  \r\n  \r\nCette variable dans la configuration de MySQL (autrefois table_cache) contrôle le nombre maximum de table placées dans le cache.\r\n\r\nLa variable <b>max_connections</b>  \r\n  \r\nCette variable dans la configuration de MySQL contrôle le nombre maximum de connexions ouvertes sur MySQL.\r\n\r\nLa variable <b>table_definition_cache</b>  \r\n  \r\nCette variable dans la configuration de MySQL permet de limiter les cache des tables uniquement à leur descriptions ce qui limite l''occupation mémoire mais accèlère le cache normal.', 'full_html', 1, 'und', 0),
(78, 2, 'Activation du cache des tables', '<b>Le cache des tables</b>\r\n\r\nL''approche  ''the bigger is the better'' ne fonctionne pas avec MySQL et entraîne des dépassement mémoire qui peuvent faire tomber le serveur et dans certains cas un cache trop important peut dégrader lesperformances de MySQL.    \r\n\r\n<b>Activation du cache </b>\r\n\r\nOn a préalablement activer les directives table_opened_cache (ou table_cache) exprimée en nombre de tables et dont la valeur par défaut est 64 et max_connections dont la valeur par défaut est 100. On va ensuite laisser le site fonctionner pendant plus d''une semaine.  N.B. Toute modification de my.cnf demande un redémarrage complet de MySQL, il n''y a pas de reload possible pour MySQL. \r\n\r\n<b>Evaluation de la taile du cache </b>\r\n\r\nIl y a deux manières de calculer la taille optimale du cache :\r\n\r\n1) Méthode théorique - On multiplie le nombre de connexions maximale permise avec la directive max_connections et on la multiplie par le nombre de tables ouvertes simultanéement dans le code (ou plus précisément le nombre de table utilisées par JOIN) pour obtenir le nombre max de tables qui seront ouvertes et définir la taille du cache.\r\n\r\n2) Méthode empirique - On va tester la taille de la valeur des tables ouvertes par MySQL sur l''ensemble de la période (depuis son démarrage)   avec la commande : mysql > SHOW GLOBAL STATUS Like ''Opened_tables'' .  1 heure après on relance la même commande est si cette valeur a augmentée c''est que la taille du cache est encore plus importante que la configuration table_opened_cache (ou table_cache) est insuffisante donc on l''augmente et on redémarre MySQL. N.B. Les variables ''opened_tables'' concerne les tables qui sont lues dans les fichiers et non pas celle qui sont chargées depuis le cache, ce qui signifie que si le nombre d''''opened_tables'' augmente c''est que les tables ne sont pas dans le cache.\r\n\r\nP.S. Si on est dans une situation où l''on peut pas augmenter la variable table_cache sans pour des raisons de limitations mémoire et que l''on doit se limiter à une valeur inférieure à celle voulue, on peut agir sur la variable table_definition_cache et augmenter cette valeur à celle voulue pour table_cache.\r\n\r\nEvidemment cette manipulation doit être faite de temps en temps pour améliorer l''évaluation de la taille de cache nécessaire. Le laps de temps pour cette observation est liée à la fréquentation du site.\r\n\r\n<b> Augmenter le file descriptor</b>\r\n\r\nIl n''est pas inutile d''agir sur la limitation Linux du nombre de file descriptor ouvrable par un process sachant que MySQL en utilise beacoup (des handles) pour son cache. On peut améliorer les performances en augmentant le nombre de file descriptor par process (la valeur Linux par défaut est 1024) avec la commande ulimit comme par exemple # ulimit -n 2048 (uniquement sous root). \r\n\r\nCette mofication est exactement la même que modifier la variable open_files_limit de my.cnf qui elle aussi appelle ulimit mais il convient aussi de la modifier selon le cacul suivant 2 * nombre de table MyISAM + 1 pour l''ensemble de tables InnoDB * la variable table_opened_cache.\r\n\r\nVoir : http://serverfault.com/questions/78786/tuning-and-understanding-table-cache-in-mysql ', 'plain_text', 0, 'und', 0),
