(77, 2, 'Cache Thread', 'Comme tous les services Unix, MySQL a un cache de thread qui lui permet de ne pas à avoir à recréer sans arrêt des threads (ce qui consomme de la CPU) mais réaffecter des threads qui ont été utilisés.', 'plain_text', 2, 'und', 0),
(79, 2, 'Cache Thread', 'Optimisation du cache des thread\r\n\r\nIl faut suivre le ratio de création des threads avec la commande :   \r\n  \r\nmysql > SHOW GLOBAL STATUS LIKE ''thread%''\r\n\r\nThreads_cached montre le nombre thred qui sont actuellement dans le cache et Threads_connected donne le nombre de connexions actuellement ouvertes, certaines de ces connexions peuvent être dans l''état sleeping et donc Threads_running donne le noombre de thread qui ne sont pas dans l''état sleeping. L''indicateur le plus intéressant est Threads_created qui donne le nombre de fois qu''un thread a été crée (et pas réactivé dans le cache) depuis que MySQL a été redémarré. Cette valeur étant indépendant du MySQL uptime cette valeur n''est pas significative. Par contre le ratio de changement c''est à dire à quelle vitesse cette valeur évolue est interressant. Si le nombre de threads crées évolue rapidement alors il faut augmenter la variable thread_cache_size dans le cas d''une augmentation modeste cela n''aura pas d''impact.\r\n\r\nCette mesure peut être complétée par un indicateur pertinent en divisant le nombre de connexion par la valeur de Threads-created (158703). On obtient le nombre de connexions par la requête suivante :\r\n\r\nmysql > SHOW GLOBAL STATUS LIKE ''connections%''\r\n\r\nLe nombre de connexions / Threads_created dans le cas où ilest bas permet de conclure que la majorité des connexions utilisent des threads du cache et l''inverse dans le cas où il est haut. Il faut relativiser cette mesure doit être modérée par le fait qu''il ne donne pas le nombre actuel de thread crées. Pour un ratio très bas cela implique que pour un serveur avec une activité basse un ou deux nouveau thread est crée chaque minute, pour une serveur avec une importante activité des centaines de thread sont crées toutes le minutes. Mais dans tous les cas il permet d''augmenter si necessaire la taille du cache des threads.', 'plain_text', 1, 'und', 0),
(80, 2, 'Buffer', 'Moins importants que le cache des tables ou des threads on peut aussi agir sur les buffer de MySQL avec les variables suivantes :   \r\n\r\nsort_buffer_size   \r\n\r\nCe buffer est alloué par client pour toute les requêtes qui réclament un tri avec ORDER BY, GROUP BY. Dans le cas où le buffer est trop important il va consommer beaucoup de mémoire va être consommée si le nombre de connexion est important (et donc la variable max_connections). Pour Linux MySQL urtilise nmap() plutôt que malloc() pour allouer des buffers de taille supérieure à 256KB et il est plutôt lent. Idéalement il faut laisser le buffer à 256KB ou moins avec une limite supérieure à 2MB. Si on utilise peut de requêtes de tri il est recommandé de donner une valeur par défaut faible et de l''augmenter par un SET SESSION avant chaque requête de ce type.   \r\n\r\nread_buffer_size   \r\n\r\nCe buffer est utilisé dabs ke cas de requêtes qui lance des scans séquentiels de table. Les mêmes règles que pour le buffer précédent s''appliquent. Les requêtes utilisent LIMIT peuvent provoquer une dégradation des performances si read_buffer_size est trop grand parce que l''ensemble de la table qui est lue est transférée dans le buffer même si seules les enregistrements spécifiés par LIMIT sont renvoyées.   ', 'plain_text', 2, 'und', 0);
INSERT INTO `taxonomy_term_data` (`tid`, `vid`, `name`, `description`, `format`, `weight`, `language`, `i18n_tsid`) VALUES
(81, 2, 'MyISAM', 'Il existe des options de tunning spécifiques aux tables MyISAM\r\n\r\n<b>Le ''Key Cache'' </b>\r\n\r\nLe Key Cache de MyISAM est un buffer en mémoire qui stocke les index accèdés le plus souvent. La taille de ce cache est le paramètre de tunning le plus important de MyISAM.  La variable key_buffer_size permet de spécifier la valeur de ce buffer. Ce cache doit être activé pour éviter les accès disque et une valeur raisonnable doit lui être donnée. Pour un serveur dédié MySQL une valeur de valeur entre 25 et 50% de la mémoire totale doit lui être donnée. Ce choix peut être excessif si on a beaucoup de mémoire ou un nombre de tables réduit et conduire au dépassement mémoire ce qui conduit à des swap sur disque. P.S. Cette valeur ne concerne pas les tables InnoDB qui ont leur propre cache.   \r\n\r\nUne méthode pour calculer la taille de ce buffer est la suivante, on commence d''abord par éditer la valeur de la variable avec la requête suivante : mysql> SHOW STATUS LIKE ''%key_read%''\r\n\r\nKey_read_requests donne le nombre total de requêtes pour lire un key block et Key_reads donne le nombre de fois qu''un key block a été lu sur le disque parce qu’il n''était pas dans le cache. On peut donc calculer le ratio de manque de cache par Key_reads divisé par Key_requests. Ce ratio ne doit pas excéder 0,01 car il est impossible de vouloir que Key_reads soit égal à 0.\r\n\r\nOn peut affiner ce ratio en se basant sur un intervalle de temps en lançant la même commande à 30 secondes d''intervalle et en soustrayant les valeurs des Key_read_requests pour savoir combien de requêtes dans l''index ont été effectuées sur cet intervalle et de soustraire les Key_reads pour savoir par rapport au nombre de reqiêtes combien sont susceptibles d''avoir entraîner un accès disque. On peut aussi affiner cette mesure avec mysqladmin en regénèrant a requête à intervalle régulier et obtenir une liste de valeurs avec la commande : # mysqladmin ext -ri60 | grep Key_reads (ici la mesure est faite toute les minutes).\r\n\r\n<b>Index Preloading   </b>\r\n\r\nQuand MyQL démarre, le cache des lés est vide et les block d''indexes sont grduellement ajoutés au  cache chaque fois qu''ils font l''objet d''un accès disque. Cela crée un peu d''overhead on peut donc préchargé l''ensemble des indexes dans le buffer en utilisant la requête LOAD INDEX INTO CACHE <nom_de_la_table>. Cela a pour avantage d''améliorer l''accès séquentiel  au blocks et empêcher les lectures sur le disque. Cette technique a pour désavantage de charger des block d''indexes qui seront pas ou peu utilisés créant ainsi un gaspilage de la mémoire. Index Preloading\r\n\r\nLa variable preload_buffer_size peut être utilisée pour spécifier la taille du cache utilisé pour le préchargement des indexes. La valeur par défaut est de 32768 avec des valeurs acceptées dans l''intervalle 1024 à 1073741824 Octets (1Go).\r\n\r\n<b>Optium Block sizes</b>\r\n\r\nMySQL permet de contrôler la taille des blocks de mémoire utilisés dans le cache avec la variable key_cache_block_size. On peut aussi optimiser la taille des blocks dans l''index physique en utilisant l''option de démarrage -myisam_block_size avec des valeurs comprises entre 512 octets à 16384 octet et une valeur par défaut de 1024 octets.\r\n\r\n<b>Caches Multiples</b>\r\n\r\nOn peut utiliser des caches multiples selon techniques des caches Hot/Cold/Warm préconisées par MySQL (voir http://stage.toadworld.com/platforms/mysql/w/wiki/6178.tables-key-cache-tuning-of-myisam.aspx).\r\n\r\n<b> Autres Options spécifiques à MyISAM</b>\r\n\r\nConcurrent_insert   \r\n\r\nActivée par défaut cette option permet les INSERT d''être exécutés dans une table en même temps que les SELECT qui les lisent. Cela résoud en partie le problème du ''locking'' des tables propre à MyISAM mais ne résoud pas celui du locking des UPDATE et DELETE. Cette option support trois configurations :\r\nSi cette option est à O elle est désactivée\r\nSi cette option est à 1 (par défaut) elle active les INSERT concurrents quand il n''y a pas d''enregistrements supprimées au milieu de la table \r\nSi cette option est à 2 elle permet les INSERT concurrents même si des enregistrements ont été supprimées mais si un SELECT est exécuté, les données seront insérées à la fin de la table, autrement elles seront insérées dans l''espace laissé par les enregistrement supprimés.\r\n\r\nlow_priority_updates  \r\n\r\nContrairement à son nom cette option ne fait pas que baisser les priorités des UPDATE mais s''applique aussi au DELETE et INSERT. Cela entraîne que les requêtes qui modifient la table ont une priorité inférieure à celle qui les lisent c-a-d les SELECT. Donc si de multiples requêtes SELECT arrivent sur la table, les requêtes de modification sont poussées en bas de la file d''attente. Si on choisit de ne pas appliquer cette option globallement elle peut malgré tout être utiilisée pour chaque stetment avec un UPDATE low_priority INTO ...\r\n\r\ndelay_key_write   \r\n\r\nQuand un index/clé de MyISAM est mis à jour, le comportement par défaut est d''écrire les changements sur le disque. Pour les tables modifiées fréquemment cela peut entraîner beaucoup d''écriture sur le disque. En activant l''option delay_key_write soit sur une table soit globalement avec le mot-clé ALL les changements sur les indexes sont plcés dans un buffer en mémoire et en mis en attent d''écriture tant que la table n''est pas fermée. Cela augmente très largement la performance des UPDATE. L''inconvénient est que si MySQL n''est pas arrêté proprement il y a des chances que l''index soit corrompu (parce que le buffer n''a pas été écrit sur le disque). On peut réparer cela par l''outil myisamchk bien que cela puisse prendre beaucoup de temps sur des tables de taille importante. \r\n', 'full_html', 3, 'und', 0),
(82, 2, 'InnoDB', 'InnoDB a un outil dédié de monitoring que l''on lance par la commande suivante : SHOW engine innodb status/G. Cette commande fournit des informations détaillées sur la sante de InnoDB incluant les thread, buffers et sémaphores. \r\n\r\n<b>innodb_buffer_pool_size</b>\r\n\r\nLe innodb_buffer_pool_size cité dans my.cnf est le cache les plus important fourni par InnoDB au même titre que le key buffer de MyISAM. Mais si le MyISAM key buffer ne cache que les indexes laissant le cache de données au système d''exploitation, InnoDB cache les indexes et les données dans son buffer pool. Comme cette tâche est complexe elle utilise un algoritm plus sophistiqué que le LRU. Dans un monde idéal le cache est suffisamment important pour ne plus permettre d''accès disques. Mais cela dépend de la taille des données et cela n''est pas toujours possible. Pour un hardware de 32 bits l''adresse ne peut pas dépasser 4Go de mémoire mais comme d''est une architecture dépassée elle n''est plus un facteur de limite. Même si toute les données ne peuvent tenir dans la mémoire, il faut tout de même chercher à crée un buffer pool le plus grand possible tout en veillant à laisser suffisamment de mémoire pour le reste des applications.  \r\n   \r\nUn problème qui peut intervenir est que le disk buffering est implémenté par le système d''exploitation et beaucoup d''OS réduisent les accès disque en utilisant leur propre buffer ce qui a pour effet de dupliquer le buffer. Ces cas de double-buffering crée des espace mémoire qui contiennent des données dupliqués, il faut donc veiller à désactiver le cache system su on souhaite s''appuyer sur le cache d''InnoDB. Cela est rendu possible par MySQL qui dans my.cnf permet de définir la variable innodb_flush_method à laquelle on doit donner la valeur O_DIRECT pour éliminer le cache au niveau du système d’exploitation.\r\n\r\n<b>Gérer le buffer pool   </b>\r\n\r\nInnoDB utilise un algoritme LRU modifié pour gérer le buffer pool basé sur MID. Avec le buffer pool d''InnoDB la division par défaut de la cold list (qui contient les items accédés le moins souvent) est de 37 % de la taille du pool avec une hot list (les items accèdés le plus souvent) qui utilise l''espace restant. On peut décider de changer cette valeur avec la variable innodb_old_blocks_pct qui accepte des valeurs de 5 à 95. Pour les applications qui accèdent occasionellement à de tables de taille importante, il est justifié de reduire innodb_old_blocks_pct pour prévenir des données accédées moins souvent d''être placées dans le cache mais au contraire pour des tables de petite taille avec des accès fréquent il est logique d''augmenter innodb_old_blocks_pct afin que les données soient plus rapidement placée en mémoire.\r\n\r\n<b>Background threads</b>\r\n\r\nLes versions précédentes d''InnoDB utilisaient un seul thread en background pour écrire et lire sur le disque mais avec InnoDB 1.0.4 ce nombre est maintenant configurable. Chaque thread peut gérer 256 requêtes et un maximum de 64 threads peuvent être configurés. Deux options de configuration le permettent et chacun accepte des valeurs de 1 à 64 avec par défaut la valeur de 4, ils sont innodb_read_io_threads (maximum de thread de lecture) et innodb_write_io_threads -maximum des thread d’écriture). Avant d’augmenter ces valeurs il faut se rappeler qu''elle ne vont pas augmenter le besoin en bande passante sur les disques même si cela va alléger les goulots d''étranglement dans les environnements très sollicités où les données sont réparties sur des disques multiples. Le monitor d''InnoDB permet d''afficher les pending reads et pending writes pour juger les besoins en thread de backgound. Sachant que chaque thread a une file d''attente de 256 requêtes, si on trouve plus de 256 x nombre de threads de type ''pending reads ou pending writes'' cela crée un goulot d’étrangement et une augmentation graduelle des threads de background est bénéfique.\r\n\r\n<b>Compression</b>\r\n\r\nPour des tables qui sont fréquemment lues et peu écrites il peut être eintéressant de le compresser (données et indexes)  si elles sont au format InnoDB (compression zlib). Cette possiblité n''est offerte que par le type ARCHIVE et MyISAM mais uniquement pour des tables en lecture. Pour compresser une table il faut d''abord préciser la compression dans my.cnf avec les instructions suivantes :\r\n\r\ninnodb_file_per_table = ON    \r\ninnodb_file_format = Barracuda  // la compression n''est possible que si on choisit ce format de fichier   \r\n\r\nOn va ensuite compresser les tables avec les instructions ALTER ou CREATE comme par exemple :\r\n\r\nALTER TABLE test KEY_BLOCK_SIZE=8 ROW_FORMAT=COMPRESSED ;\r\n\r\nPar défaut le KEY_BLOCK_SIZE est 8k, tout simplement parce que les pages de données gérées par InnoDB sont à cette taille. On peut choisir des tailles de 1Ko à 16Ko.  Une fois la compression utilisée, on peut la surveiller grâce au informations de la table INNODB_CMP dans la base information_schema avec la commande suivante :\r\n\r\nmysql> select * from information_shema.INNODB_CMP ;\r\n\r\nOn surveillera les résultats et surtout le ratio entre les valeurs compress_ops et compress_ops_ok. La deuxième valeur doit être au moins de 90% de la première sinon cela signifie que les opérations de compressions ont tendance à échouer (c''est à dire à traiter plusieurs fois les données pour arriver à les compresser). Cela entrâine une augmentation de la charge de la CPU et peut-être lié soit à des taille de block inadaptées vis à vis des pages de InnoDB (8Ko) et dans ce cas on peut augmenter la taille des KEY_BLOCK_SIZE. Soit la taille des enregistrement de la table ne conviennent pas à une compression optimale et se poser la question de la necessité de compresser la table.\r\n\r\n', 'plain_text', 5, 'und', 0),
(89, 2, 'Le cache de requêtes', '<b>Introduction\r\n\r\nC''est une des fonctionnalités au niveau de la performance de MySQL qui est la plus intéressante. Elle a été introduite dans MySQL 4.0.1 et c''est une fonctionnalité qui peut être utilisée pour cacher les requêtes SQL et leurs réponses bien que cela ait des inconvénients. Le query cache intercepte les SELECT et les compare avec les requêtes dans sont cache. Si il trouve cette requête dans son cache la réponse de la requête cachée est retournée, sinon elle est exécuté.\r\n\r\n<b>Limites</b>\r\n\r\nChaque fois que les données sont modifiées dans une table cachée (UPDATE, DELETE …) les données dans le cache sont immédiatement invalidées, c''est souvent "overkill" mais MySQL procède comme cela. L''invalidation est la cause de la perte de performance sur le cache et dans le cas d''un site même si une table reçoit de nombreux SELECT pour des lecture dès qu''un INSERT est exécuté le cache est invalidé entièrement. Et dans le cas où une table reçoit fréquemment des UPDATE sur des données, le cache finit par être sans cesse invalidé en une fraction de seconde. \r\n\r\n<b>Configuration</b>\r\n\r\nPour configurer le cache de requête il faut vérifier que MySQL est bien compilé avec le query cache avec la commande suivante : mysql> SHOW VARIABLES LIKE ''have_query_cache''; Le YES dans la valeur de have_query_cache signifie que le cache est bien activé mais il faut aussi chercher si le query_cache_type n''est pas à zéro avec la commande suivante : mysql> SHOW VARIABLES LIKE ''query_cache_type; le query_cache_type doit avoir une valeur de ON et la commande suivante mysql> SHOW VARIABLES LIKE ''query_cache_size'' ; doit donner un query_cache_size > 0.\r\n\r\nOn peut modifier les paramètre suivants sur le cache de requête :\r\n\r\n<b>query_cache_size</b>\r\n\r\nOn pourrait croire qu''il est utile de lui donner la valeur maximale permise par la mémoire disponible mais c''est contre-productif parce que MySQL va passer son temps à maintenir et gérer le cache. Il n''y a pas de réponse pour la taille idéale et cela dépend du volume de SELECT attendus de l''application.\r\n\r\n<b>query_cache_type</b>\r\n\r\nIl existe deux types de cache. Avec une valeur à 1 c''est le cache par défaut et tous les SELECT seront cachés à moins que l''on demande explicitement à MySQL de ne pas les cacher avec l''instruction SELECT SQL_NO_CACHE. Si la valeur est a 2 cela entraîne une méthode de cache à la demande où les SELECT que l''on veut cacher commencent par SELECT SQL_CACHE. \r\n\r\n<b>query_cache_limit</b>\r\n\r\nOn utilise la directive query_cache_limit pour définir la taille maximale pour les requêtes qui seront cachées, c''est à dir qu''au-delà de cette taille les requêtes ne seront pas cachées. Cela s''explique parce que l''on veut pas des requêtes trop volumineuses dans le cache ou que l''on prévoit qu''elles sont trop volumineuses pour le cache et qu''elles ne seront donc pas cachés. La valeur par défaut est de 1MB.\r\n\r\n<b>query_cache_wlock_invalidate</b>\r\n\r\nCette directive provoque le locking d''ue table utilisée pour l''écriture et invalider le cache des SELECT donc de lecture pour cette table. \r\n\r\n<b>query_cache_min_res_unit</b>\r\n\r\nMySQL alloue de la mémoire pour le cache des requêtes à la demande dans des petits ''chunks''. Parce que la taille du résultat de la requête n''est pas connu à l''avance la mémoire est alloué en fonction des besoins. Si on augmente la taille des ''chunks'' l''allocation de la mémoire peut être plus performant. LA taille de ces ''chuncks'' peut être modifiée avec query_cache_min_res_unit ce qui entraîne la réduction à des appels pour l''allocation de plus de mémoire par MySQL.\r\n\r\n<b>Inspecter le cache</b>\r\n\r\nSurveiller l''utilisation du cache au jour le jour et en fonction de sites spécifiques est une bonne idée. On obtient des statistiques sur le cache avec la commande suivante : \r\nmysql> SHOW STATUS LIKE ''Qcache%''; Cette commande donne la liste des valeurs de variables sui sont :\r\n\r\nQcache_free_blocks – nombre de block de mémoire libre dans le cache\r\nQcache_free_memory – mémoire disponible totale\r\nQcache_hits – combien de requêtes interceptées étaient dans le cache\r\nQcache_inserts – combien de requêtes ont été insérées dans le cache\r\nQcache_lowmem_prunes – nombre d''entrées qui ont été supprimées du cache pour manque de mémoire\r\nQcache_not_cached – nombre de requêtes qui n''ont pas été cachées pour soit u manque de mémoire soit parce qu''elles n''étaient pas "cachable"\r\nQcache_queries_in_cache - nombre de requêtes dans le cache\r\nQcache_total_blocks – nombre total de block mémoire dans le cache\r\n\r\nLe fonctionnement du cache peut être aussi suivi par les commandes suivantes :\r\n\r\nmysql> SHOW GLOBAL STATUS LIKE ''com_delete'';   \r\nmysql> SHOW GLOBAL STATUS LIKE ''com_update'';   \r\nmysql> SHOW GLOBAL STATUS LIKE ''com_insert'';  \r\nmysql> SHOW GLOBAL STATUS LIKE ''com_select'';   \r\n\r\nCe commandes permettent de suivre les volumes de INSERT, SELECT, DELETE et UPDATE réalisés. Ces indicateurs sont pertinent qu''après un temps significatif de fonctionnement puisque ces variables sont réinitialisées au démarrage de MySQL.\r\n\r\n\r\n\r\n', 'full_html', 5, 'und', 0),
(90, 2, 'Applications', '', 'plain_text', 2, 'und', 0),
(91, 2, 'Optimisation SQL', 'Lors de la phase de debbuging des applications, il est utile d''optimiser le SQL qu''elles mettent en oeuvre avec :\r\n\r\n<b>Slow Query Log</b>   \r\n\r\nMySQL permet de "logger" les requêtes dont l''exécution dépassent un certain laps de temps. Pour cela il faut ajouter les directives suivantes dans my.cnf :\r\n\r\nlong_query_time = 7  // Log les requêtes qui dépassent 7 secondes   \r\nslow_query_log = 1   \r\nslow_query_log_file = /var/log/mysql/slow_queries.log   \r\nlog-queries-not-using-indexes = 1\r\n\r\nLes informations obtenues dans le log doivent tenir compte des évènements externes qui se sont possiblement produit lors du log (surcharge serveur, backup ...). On diagnotiquera plus précisément avec la recherche du temps d''exécution à l''aide du CLI de MySQL, les process en cours avec SHOW PROCESSLIST ou bien l''utilisation de l''instruction de la commande EXPLAIN dans la requête pour avoir plus d''informations sur les raisons de sa lenteur. La directive log-queries-not-using-indexes = 1 permet de logger les requêtes qui n''utilisent pas des index et qui sont donc potentiellement bbeaucoupp lentes que les autres.\r\n\r\n<b>mysqldumpslow</b>\r\n\r\nPour les log slow query de petite taille on peut les traiter manuellement mais pour les log de grande taille mysqldumpslow peut permettre de traiter des logs en comptant le nombre d’occurrences pour chaque requête ''loggée''.', 'full_html', 0, 'und', 0),
(92, 2, 'Munin', 'Système de monitoring de l''ensemble de la machine. Pour un test sur un site, il faut ajouter les modules Apache et MySQL.\r\n\r\n<h4>Installer le Plugin Apache</h4>\r\n\r\nPour monitorer Apache, on va éditer d''abord éditer le fichier de configuration d''apache apache2.conf et y insérer :\r\n\r\n<IfModule mod_status.c>\r\n    <Location /server-status>\r\n        SetHandler server-status\r\n        Order deny,allow\r\n        Deny from all\r\n        Allow from 127.0.0.1\r\n    </Location>\r\n</IfModule>\r\n\r\nPuis ajouter toujours dans apache2.conf\r\nExtendedStatus On\r\n\r\nOn active ensuite le module info par :\r\na2enmode info\r\n\r\nOn redémarre Apache puis on vérifie que les liens symbliques suivants existent dans /etc/munin/plugins :\r\napache_accesses -> /usr/share/munin/plugins/apache_accesses \r\napache_processes -> /usr/share/munin/plugins/apache_processes \r\napache_volume -> /usr/share/munin/plugins/apache_volume \r\n\r\nSinon on les crée avec :\r\ncd /etc/munin/plugins/\r\nsudo ln -s /usr/share/munin/plugins/apache_accesses apache_accesses\r\nsudo ln -s /usr/share/munin/plugins/apache_processes apache_processes\r\nsudo ln -s /usr/share/munin/plugins/apache_volume apache_volume\r\n\r\nPuis on vérifie qu''il ne manque pas une librairie avec :\r\n/usr/share/munin/plugins/apache_processes\r\nSi on a des messages du type :\r\n\r\nLWP::UserAgent not found at /usr/share/munin/plugins/apache_processes line 93 ou Can''t locate object method "new" via package "LWP::UserAgent" at /usr/share/munin/plugins/apache_processes line 134\r\n\r\nC''est que généralement on a pas installer un package perl et on l''installe :\r\n apt-get install libwww-perl\r\n\r\nOptionnellement on va modifier le fichier de configuration des plugins avec la commande :\r\nnano -w /etc/munin/plugin-conf.d/munin-node\r\n\r\nEt on va ajouter les ligne suivantes :\r\n[apache_processes]\r\nenv.url http://localhost:%d/server-status?auto\r\nenv.port 80  \r\n \r\n[apache_accesses]\r\nenv.url http://localhost:%d/server-status?auto\r\nenv.port 80 \r\n \r\n[apache_volume]\r\nenv.url http://localhost:%d/server-status?auto\r\nenv.port 80 \r\n\r\n<h4> Installation du Plugin MySQL</h4>\r\n\r\nVoir http://www.debian-fr.org/monitorer-mysql-depuis-munin-t32410.html ou http://blog.leworm.fr/index.php?post/2012/01/09/Mysql-et-munin-sous-Debian \r\n\r\nIl faut éditer le fichier de configuration de muni dans /etc/munin/plugin-conf.d/munin-node et ajouter les lignes :\r\n[mysql*]\r\nuser root\r\nenv.mysqlopts --defaults-extra-file=/etc/mysql/debian.cnf \r\n\r\nPuis vérifier que les liens symboliques suivants existent dans /etc/munin/pluins/\r\nmysql_bytes -> /usr/share/munin/plugins/mysql_bytes                                                           mysql_queries -> /usr/share/munin/plugins/mysql_queries                                                      mysql_slowqueries -> /usr/share/munin/plugins/mysql_slowqueries                                              mysql_threads -> /usr/share/munin/plugins/mysql_threads \r\n\r\nAjouter les packages suivants si ils ne sont déjà installées :\r\napt-get libdbd-mysql-perl libcache-cache-perl libnet-server-perl gawk \r\n\r\nSinon les créer puis redémarrer munin avec :\r\n/etc/init.d/munin-node restar', 'full_html', 0, 'und', 0),
(93, 2, 'Cache Apache', 'Apache propose des caches sous forme de modules : mod_cache, mod_file_cache et mod_mem_cache', 'plain_text', 0, 'und', 0),
(94, 2, 'Vagrant', 'Vagrant est une solution qui permet de faire du provisionning de boxes (VM soit Virtual Box soit VMWare ou autre) qui offre un environnement de développement standard à l''ensemble des développeurs qui l''utilisent.', 'plain_text', 0, 'und', 0),
(95, 2, 'Installation', 'Vagrant est téléchargé depuis le site www.vagrantup.com et installé sur le poste local. On va ensuite se placer dans le répertoire où vagrant a été installé et lancer l''installation d''une box (nom de vagrant pour les VM) par les trois commandes suivantes :\r\n\r\n $ vagrant box add <nom_de_la_box> <url_de_la_box>\r\n $ vagrant init <nom_de_la_box>\r\n $ vagrant up\r\n\r\nPour l''url de la box, on peut aller sur http://docs.vagrantup.com/v2/getting-started/boxes.html ou bien http://www.vagrantbox.es/\r\n\r\n', 'plain_text', 0, 'und', 0);
